import React from 'react'
import {Wrapper, H1} from '../Styled';

import styled from "styled-components";

const Container = styled(Wrapper)`

`
const Form = styled.form`
    border: 2px solid var(--s-3);
    border-radius:.5em;
`

export default function Contact() {
    return (
        <Wrapper>
            <H1>Contact</H1>
            <Form></Form>

        </Wrapper>
    )
}
